To create a Chrome extension that takes screenshots of a webpage, you'll need to follow these steps:

1. **Create the necessary files**:
   - `manifest.json`: The manifest file that describes your extension.
   - `background.js`: The background script that handles the screenshot logic.
   - `popup.html`: The popup UI for the extension.
   - `popup.js`: The script for the popup UI.

2. **Set up the manifest file**:
   Create a `manifest.json` file with the following content:

   ```json
   {
     "manifest_version": 3,
     "name": "Webpage Screenshot",
     "version": "1.0",
     "description": "Take a screenshot of the current webpage.",
     "permissions": [
       "activeTab",
       "scripting"
     ],
     "background": {
       "service_worker": "background.js"
     },
     "action": {
       "default_popup": "popup.html",
       "default_icon": {
         "16": "images/icon16.png",
         "48": "images/icon48.png",
         "128": "images/icon128.png"
       }
     },
     "icons": {
       "16": "images/icon16.png",
       "48": "images/icon48.png",
       "128": "images/icon128.png"
     }
   }
   ```

3. **Create the background script**:
   Create a `background.js` file with the following content:

   ```javascript
   chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
     if (request.action === 'takeScreenshot') {
       chrome.tabs.captureVisibleTab(null, {}, (dataUrl) => {
         sendResponse({ dataUrl });
       });
       return true; // Will respond asynchronously.
     }
   });
   ```

