### 1. Loop Unrolling
Loop unrolling is a technique where the compiler duplicates the loop body multiple times to reduce the overhead of loop control.

**Example:**
```c
// Original code
for (int i = 0; i < 10; i++) {
    array[i] = i * 2;
}

// Optimized code with loop unrolling
array[0] = 0 * 2;
array[1] = 1 * 2;
array[2] = 2 * 2;
array[3] = 3 * 2;
array[4] = 4 * 2;
array[5] = 5 * 2;
array[6] = 6 * 2;
array[7] = 7 * 2;
array[8] = 8 * 2;
array[9] = 9 * 2;
```

### 2. Inlining
Inlining is a technique where the compiler replaces a function call with the actual code of the function to eliminate the overhead of function calls.

**Example:**
```c
// Original code
int add(int a, int b) {
    return a + b;
}

int main() {
    int x = 5, y = 10;
    int result = add(x, y);
    return result;
}

// Optimized code with inlining
int main() {
    int x = 5, y = 10;
    int result = x + y;
    return result;
}
```

### 3. Dead Code Elimination
Dead code elimination is a technique where the compiler removes code that does not affect the program's output.

**Example:**
```c
// Original code
int main() {
    int x = 5;
    int y = 10;
    int z = x + y; // z is never used
    return x;
}

// Optimized code with dead code elimination
int main() {
    int x = 5;
    return x;
}
```

### 4. Constant Folding
Constant folding is a technique where the compiler evaluates constant expressions at compile time rather than at runtime.

**Example:**
