using System;
using System.IO;
using System.Net;
using System.Net.Sockets;
using System.Text;

class TcpClientExample
{
    static void Main()
    {
        try
        {
            // Create a TcpClient to connect to the server
            using (TcpClient client = new TcpClient("192.168.0.3", 40957))
            {
                // Get the network stream for reading and writing
                using (NetworkStream stream = client.GetStream())
                {
                    // Read the welcome message
                    string welcomeMessage = ReadMessage(stream);
                    Console.WriteLine("Welcome message: " + welcomeMessage);

                    // Send login message
                    SendMessage(stream, "LGIN x-stream");

                    // Read login response
                    string loginResponse = ReadMessage(stream);
                    Console.WriteLine("Login response: " + loginResponse);

                    if (loginResponse == "Password correct")
                    {
                        // Send GTMP? message
                        SendMessage(stream, "GTMP?");

                        // Read temperature response
                        string temperatureResponse = ReadMessage(stream);
                        Console.WriteLine("Temperature response: " + temperatureResponse);
                    }
                    else
                    {
                        Console.WriteLine("Login failed. Exiting...");
                        return;
                    }

                    // Send LOGOUT message
                    SendMessage(stream, "LOGOUT");
                }
            }
        }
        catch (Exception ex)
        {
            Console.WriteLine("Error: " + ex.Message);
        }
    }

    static string ReadMessage(NetworkStream stream)
    {
        using (MemoryStream ms = new MemoryStream())
        {
            byte[] buffer = new byte[1024];
            int bytesRead;

            while ((bytesRead = stream.Read(buffer, 0, buffer.Length)) > 0)
            {
                ms.Write(buffer, 0, bytesRead);
                if (buffer[bytesRead - 1] == '\n')
                {
                    break;
                }
            }

            return Encoding.ASCII.GetString(ms.ToArray());
        }
    }

    static void SendMessage(NetworkStream stream, string message)
    {
        byte[] data = Encoding.ASCII.GetBytes(message + "\n");
        stream.Write(data, 0, data.Length);
    }
}
