Here's a JavaScript function that merges two arrays of objects with the properties `stepId`, `fieldId`, and `message`. The resulting array will contain unique objects based on the combination of `stepId` and `fieldId`. If the `message` property is not available in the first object, it will be taken from the second object.

```javascript
function mergeArrays(arr1, arr2) {
  // Create a map to store unique objects based on stepId and fieldId
  const uniqueMap = new Map();

  // Helper function to create a unique key for the map
  const createKey = (stepId, fieldId) => `${stepId}-${fieldId}`;

  // Process the first array
  arr1.forEach(item => {
    const key = createKey(item.stepId, item.fieldId);
    uniqueMap.set(key, item);
  });

  // Process the second array
  arr2.forEach(item => {
    const key = createKey(item.stepId, item.fieldId);
    if (!uniqueMap.has(key)) {
      uniqueMap.set(key, item);
    } else {
      // If the message is not available in the first object, take it from the second object
      if (!uniqueMap.get(key).message) {
        uniqueMap.get(key).message = item.message;
      }
    }
  });

  // Convert the map values back to an array
  return Array.from(uniqueMap.values());
}

